import React from 'react';
import "./getStarted.css";
// import Placeholder from "./../../assets/placeholder.jpg";

const GetStarted = () => {
  return (
    <div class = "content">
        <div class = "getStarted">
            Welcome to Marketplace Game!
            <button class = "searchButtonMain">
                Start
            </button>
        </div>
        <div class = "animation">
            <Placeholder />
        </div>
    </div>  
  )
}

export default GetStarted;
